import React from 'react';
import { Experience_Card} from '../experience/experience.component';
import "./classwork-list.css";

export const Education = props => (
    <div>
        <div className="headers">
            <h1>Education</h1>
            <p>"Education is what remains after one has forgotten what one has learned in school." - Albert Einstein</p>
        </div>
        
        <div className="text-left">
            {props.classlist.map(experience => (
                <Experience_Card
                    key={experience.id}
                    experience={experience} />
            ))}
        </div>

    </div>
    
);
